var i = 0;
for (var s of skills.keys()) {
  i++;
  document.getElementById("$Sk-" + i + "N").textContent = s;
}
function recalc(e,id) {
  document.getElementById(id).textContent = e.value;
  recalcAll();
}
function recalcAll() {
  var date = document.getElementById("$Birthdate").textContent.substring(0,6);
  document.getElementById("$Sunsign").textContent = sunsignMap.get(date);
  Array(Array.from(skills).length).fill().map((_,i) => {
  var s = skills.get(document.getElementById("$Sk-" + (i + 1) + "N").textContent);
    var sum = 0;
    s[0].map( (_,j) => { sum += parseInt(document.getElementById(s[0][j]).textContent); } );
    sum = sum/s[0].length;
    var ss = 0;
    new Map(s[1]).forEach((v,k) => {
      if (document.getElementById("$Sunsign").textContent.indexOf(k) > -1) ss = Math.max(ss,v);
    });
    sum += ss;
    sum = sum5(0,sum);
    document.getElementById("$Sk-" + (i + 1) + "L").textContent = Math.round(sum);
  });
}
function sum5(a,b) {
  var M = Math.max(a,b);
  var m = Math.min(a,b);
  return M + 5*Math.log2(1 + Math.pow(2, -(M - m)/5));
}
